enum AsiResult {
  ASI_REMOVE,
  ASI_INSERT,
  ASI_SKIP,
};
static _Bool test_symbol_end(TSLexer *lexer) {
  if (iswalpha(lexer->lookahead) || lexer->lookahead == '_') {
    return 0;
  } else {
    return 1;
  }
}
static enum AsiResult asi_symbol_end(TSLexer *lexer) {
  if (iswalpha(lexer->lookahead) || lexer->lookahead == '_') {
    return ASI_INSERT;
  } else {
    return ASI_REMOVE;
  }
}
static _Bool test_symbol(TSLexer *lexer, const char *expected) {
  for (size_t i = 0; expected[i]; i++) {
    if (lexer->lookahead != expected[i]) {
      return 0;
    }
    advance(lexer);
  }
  return test_symbol_end(lexer);
}
static enum AsiResult asi_symbol(TSLexer *lexer, const char *expected) {
  for (size_t i = 0; expected[i]; i++) {
    if (lexer->lookahead != expected[i]) {
      return ASI_INSERT;
    }
    advance(lexer);
  }
  return asi_symbol_end(lexer);
}
static enum AsiResult
can_insert_semi(TSLexer *lexer, struct ScannerState *state) {
  if (state->multiline_string) {
    switch (lexer->lookahead) {
    case '#':
      advance(lexer);
      switch (lexer->lookahead) {
      case '|':
        return ASI_REMOVE;
      default:
        break;
      }
    case '$':
      advance(lexer);
      switch (lexer->lookahead) {
      case '|':
        return ASI_REMOVE;
      default:
        break;
      }
    default:
      break;
    }
  }
  switch (lexer->lookahead) {
  case '+':
    advance(lexer);
    switch (lexer->lookahead) {
    case '=':
      return ASI_REMOVE;
    default:
      return ASI_INSERT;
    }
  case '-':
    advance(lexer);
    switch (lexer->lookahead) {
    case '=':
      return ASI_REMOVE;
    default:
      return ASI_INSERT;
    }
  case '*':
    advance(lexer);
    switch (lexer->lookahead) {
    case '=':
      return ASI_REMOVE;
    default:
      return ASI_INSERT;
    }
  case '/':
    advance(lexer);
    switch (lexer->lookahead) {
    case '/':
      return ASI_SKIP;
    case '=':
      return ASI_REMOVE;
    default:
      return ASI_INSERT;
    }
  case '|':
    advance(lexer);
    switch (lexer->lookahead) {
    case '>':
      return ASI_REMOVE;
    case '|':
      return ASI_INSERT;
    default:
      return ASI_REMOVE;
    }
  case '%':
    advance(lexer);
    switch (lexer->lookahead) {
    case '=':
      return ASI_REMOVE;
    default:
      return ASI_INSERT;
    }
  case '.':
  case ':':
  case ',':
  case ')':
  case ']':
  case ';':
  case '=':
  case '?':
  case '!':
    return ASI_REMOVE;
  case 'a':
    advance(lexer);
    switch (lexer->lookahead) {
    case 's':
      advance(lexer);
      return asi_symbol_end(lexer);
    default:
      return ASI_INSERT;
    }
  case 'i':
    advance(lexer);
    switch (lexer->lookahead) {
    case 's':
    case 'n':
      advance(lexer);
      return asi_symbol_end(lexer);
    default:
      return ASI_INSERT;
    }
  case 'e':
    advance(lexer);
    return asi_symbol(lexer, "lse");
  case 'c':
    advance(lexer);
    return asi_symbol(lexer, "atch");
  case 'd':
    advance(lexer);
    return asi_symbol(lexer, "erive");
  case 'w':
    advance(lexer);
    return asi_symbol(lexer, "ith");
  default:
    return ASI_INSERT;
  }
}
_Bool tree_sitter_moonbit_external_scanner_scan(
  void *payload,
  TSLexer *lexer,
  const _Bool *valid_symbols
) {
  struct ScannerState *context = (struct ScannerState *)payload;
  if (lexer->eof(lexer)) {
    return 0;
  }
  if (valid_symbols[FLOAT_LITERAL]) {
    if (scan_float_literal(lexer, valid_symbols)) {
      lexer->mark_end(lexer);
      lexer->result_symbol = FLOAT_LITERAL;
      return 1;
    }
  }
  if (valid_symbols[MULTILINE_STRING_SEPARATOR] || valid_symbols[MULTILINE_INTERPOLATION_SEPARATOR]) {
    skip_spaces(lexer, valid_symbols);
    if (valid_symbols[MULTILINE_STRING_SEPARATOR] && lexer->lookahead == '#') {
      advance(lexer);
      if (lexer->lookahead == '|') {
        advance(lexer);
        lexer->result_symbol = MULTILINE_STRING_SEPARATOR;
        lexer->mark_end(lexer);
        context->multiline_string = 1;
        return 1;
      }
    } else if (valid_symbols[MULTILINE_INTERPOLATION_SEPARATOR] && lexer->lookahead == '$') {
      advance(lexer);
      if (lexer->lookahead == '|') {
        advance(lexer);
        lexer->result_symbol = MULTILINE_INTERPOLATION_SEPARATOR;
        lexer->mark_end(lexer);
        context->multiline_string = 1;
        return 1;
      }
    }
  }
  if (valid_symbols[FOR_KEYWORD]) {
    skip_spaces(lexer, valid_symbols);
    if (test_symbol(lexer, "for")) {
      lexer->result_symbol = FOR_KEYWORD;
      lexer->mark_end(lexer);
      skip_blanks(lexer);
      if (lexer->lookahead == '\n') {
        context->remove_semi = 1;
      }
      return 1;
    }
  }
  if (valid_symbols[AUTOMATIC_SEMICOLON]) {
    while (iswblank(lexer->lookahead)) {
      skip(lexer);
    }
    if (lexer->lookahead != '\n') {
      return 0;
    }
    advance(lexer);
    lexer->result_symbol = AUTOMATIC_SEMICOLON;
    lexer->mark_end(lexer);
    while (iswspace(lexer->lookahead)) {
      advance(lexer);
    }
    enum AsiResult insert_semi = can_insert_semi(lexer, context);
    if (insert_semi == ASI_SKIP) {
      return 0;
    }
    if (context->remove_semi) {
      insert_semi = ASI_REMOVE;
    }
    if (context->remove_semi || context->multiline_string) {
      tree_sitter_moonbit_external_scanner_reset(context);
      if (insert_semi == 0) {
        lexer->result_symbol = AUTOMATIC_NEWLINE;
        return 1;
      }
    }
    return insert_semi == ASI_INSERT;
  }
  return 0;
}
